  return (
    <div>
      <h1>Task Manager</h1>
      <h4>This is home page</h4>
      <Routes>
        <Route path="tasks" element={ <AllTasks/> } />
        <Route path="task" element={ <SingleTaskPage/> } />
      </Routes>
      {/* <AllTasks/> */}
    </div>
  )
}
